    private void jButton10ActionPerformed(java.awt.event.ActionEvent evt) {//GEN-FIRST:event_jButton10ActionPerformed
       
        String departement = this.departement.getText().trim().replaceAll("'", "''") ;
        if(departement.equalsIgnoreCase("DEPARTEMENT")){
            JOptionPane.showMessageDialog(null, "paramettre incorrect");
        }else{
            
            // departement creation in our serveur ......
            
            
             Connection conn = null ;
             Statement stmt = null ;
       
       try{
      //STEP 2: Register JDBC driver :
      Class.forName(JDBC_DRIVER) ;

      //STEP 3: Open a connection
     // System.out.println("Connecting to database...");
      
      conn = DriverManager.getConnection(DB_URL,USER,PASS);

      //STEP 4: Execute a query
      //System.out.println("Creating statement...");
      stmt = conn.createStatement();
      
      //je crai ma requete
       
      
      
      String sql = null ;
      ResultSet rs = null ;
      
       
      
      
         DefaultTableModel  dtm =(DefaultTableModel) this.tdep.getModel() ;
                            dtm.setRowCount(0) ;
         
         
   Integer vy = 0 ;
      
       sql = "SELECT * from departement where description = '"+departement+"'" ;
      
       rs = stmt.executeQuery(sql) ;
      
      
     while(rs.next()){
        
        vy = 1 ;
        
        
        
     }
     
     
     if(vy == 1){
         JOptionPane.showMessageDialog(null, "DEPARTEMENT EXISTE DEJA !");
     }else if(vy == 0){
         // DML : 
         
         if(stmt.executeUpdate("insert into departement(description, etat) values('"+departement+"' , 'OUI')") == 1){
             
             sql = "select id, description, etat from departement order by description asc" ;
             rs = stmt.executeQuery(sql) ;
             while(rs.next()){
                 
                 dtm.addRow(new Object[]{
            
        //  "ID", "CATEGORIE", "DESCRIPTION", "DIMENSION", "PRIX", "QTE MIN", "PRIX C", "CODE IMAGE", "ETAT", "NOMBRE"
            
           rs.getInt("id") , rs.getString("description") , rs.getString("etat")
         
        }) ;
                 
             
             }
             
         }
         
         
         this.departement.setText("") ;
         
     }
      
      
     
      
    
            
      //STEP 6: Clean-up environment
      
   // System.out.println("Goodbye!");
      
   
      
      //STEP 6: Clean-up environment
      rs.close();
      stmt.close();
      conn.close();
      
      
   }catch(SQLException se){
      //Handle errors for JDBC
      se.printStackTrace();
   }catch(Exception e){
      //Handle errors for Class.forName
      e.printStackTrace();
   }finally{
      //finally block used to close resources
      try{
         if(stmt!=null)
            stmt.close();
      }catch(SQLException se2){
      }// nothing we can do
      try{
         if(conn!=null)
            conn.close();
      }catch(SQLException se){
         se.printStackTrace();
      }//end finally try
   }//end try
        
          
       
       
            
            
        }
        
        
        
    }//GEN-LAST:event_jButton10ActionPerformed

