    private void jButton25ActionPerformed(java.awt.event.ActionEvent evt) {//GEN-FIRST:event_jButton25ActionPerformed
        // TODO add your handling code here:
        
        SimpleDateFormat sdf = new SimpleDateFormat("yyyy-MM-dd") ;
        String enfant , ns ;
        
        enfant = this.enfant.getText().trim().replaceAll("'", "''") ;
        ns = sdf.format(this.d_n_ef.getSelectedDate().getTime()) ;
        
        Enfant ef = new Enfant() ;
               ef.setNom(enfant) ;
               ef.setNaissance(ns) ;
               
               DefaultTableModel dtm = (DefaultTableModel) this.tenfant.getModel() ;
               
      if(this.list_vy.contains(new String(ef.getNom())) || "ENFANT (PRENOM)".equalsIgnoreCase(ef.getNom())){
          
          JOptionPane.showMessageDialog(null, "ENFANT : "+ef.getNom()+" EXIST DEJA OU PARAMETTRE INCORRECT!");
      
      }else{
          
          this.list_vy.add(new String(ef.getNom())) ;
          this.list_e.add(ef) ;
          
          Object[] i = new Object[]{"" , ef.getNom() , ef.getNaissance() , ""} ;
          
          dtm.addRow(i);
          
          this.enfant.setText("ENFANT (PRENOM)");
          
      }
        
        
         
    }//GEN-LAST:event_jButton25ActionPerformed

    private void jButton26ActionPerformed(java.awt.event.ActionEvent evt) {//GEN-FIRST:event_jButton26ActionPerformed
        // TODO add your handling code here:
        
        
        
        if(this.tenfant.getSelectedRow() == -1){
            JOptionPane.showMessageDialog(null, "PARAMETTRE INCORRECT !!!") ;
        }else{
            this.list_vy.remove(this.tenfant.getSelectedRow()) ;
            this.list_e.remove(this.tenfant.getSelectedRow()) ;
            
            DefaultTableModel dtm = (DefaultTableModel) this.tenfant.getModel() ;
            
            dtm.removeRow(this.tenfant.getSelectedRow()) ;
            
        }
        
        
    }//GEN-LAST:event_jButton26ActionPerformed

